import { Card, Input, Form } from "antd";

const Join = () => (
  <Form>
    <Form.Item
      name="email"
      label="E-mail"
      rules={[
        {
          type: "email",
          message: "The input is not valid E-mail!",
        },
        {
          required: true,
          message: "Please input your E-mail!",
        },
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      name="password"
      label="password"
      rules={[
        {
          type: "password",
        },
        {
          required: true,
          message: "Please input your password",
        },
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      name="passwordCheck"
      label="password check"
      rules={[
        {
          required: true,
          message: "Please input your password check",
        },
      ]}
    >
      <Input />
    </Form.Item>
  </Form>
);

export default Join;
